#include <iostream>
#include <string>
#include <vector>
#include <unordered_map>

class Solution
{
public:
	inline char findTheDifference(std::string &s, std::string &t)
	{
		// method 1:
		// runtime : 3ms

		// std::unordered_map<char, int> m;
		// for (const auto c : s)
		// 	m[c]++;

		// for (const auto c : t)
		// {
		// 	m[c]--;
		// 	if (m[c] < 0)
		// 		return c;
		// }

		// return t[0];

		// method 2:
		// runtime: 0ms

		std::unordered_map<char, int> m;
		int i = 0;
		for (i = 0; i < s.size(); i++)
		{
			m[s[i]]++;
			m[t[i]]--;
		}
		m[t[i]]--; // last element in t

		for (auto it = m.begin(); it != m.end(); it++)
		{
			if (it->second == -1)
				return it->first;
		}

		return t[0];
	}
};

int main()
{
	std::string s = "";
	std::string t = "";
	// std::string s = "abcd";
	// std::string t = "abcde";
	Solution so;
	std::cout << "ans: " << so.findTheDifference(s, t) << std::endl;
	return 0;
}